import { useSelector, useDispatch } from "react-redux";
import { JobPosition } from "./JobPosition";
import { selectorAllPosition } from "store/position/position-selector";
import { addFilter } from "store/filters/filter-action";

const JobList = () => {
  const position = useSelector(selectorAllPosition);
  const dispatch = useDispatch();

  const handleAddFiler = (filer) => {
    dispatch(addFilter(filer));
  };

  return (
    <div className="job-list">
      {position.map((item) => (
        <JobPosition key={item.id} {...item} />
      ))}
    </div>
  );
};

export { JobList };
